import React, { Component } from 'react';
import { Link } from 'react-router-dom';
//import DashboardIcon from './../../../components/UI/Logo/DashboardLogo/DashboardLogo';
import DashboardIcon from '@material-ui/icons/Dashboard';
import AssignmentIcon from '@material-ui/icons/Assignment';
//import PostfachIcon from './../../../components/UI/Logo/POBox Logo/POBoxLogo';
//import SettingsIcon from './../../../components/UI/Logo/SettingsLogo/SettingsLogo';
//import TasksIcon from './../../../components/UI/Logo/TasksLogo/TasksLogo';
import EmailIcon from '@material-ui/icons/Email';
import SettingsIcon from '@material-ui/icons/Settings';


import classes from './Sidenav.css';

class Sidenav extends Component {

  render (){

    return (
      <div>
        <div className={classes.Sidenav}>
          
            <div>
              <Link className="nav-link active" to="/dashboard" ><DashboardIcon/></Link>
              <Link className="nav-link" to="/tasks" ><AssignmentIcon/></Link>
              <Link className="nav-link" to="/emails" ><EmailIcon/></Link>
              <Link className="nav-link" to="/settings" ><SettingsIcon/></Link>
            </div>
        </div>
      </div>
    )
  
  }  
};

export default Sidenav;
